'use strict';
let Terminal = require('./Terminal.js');
//@@DocBrief("The builder of the Terminal class")
class TerminalBuilder extends Terminal {
    setType(type) {
        this.type = type;
    }
    setName(name) {
        this.name = name;
    }
    setSubId(subId) {
        this.subId = subId;
    }
    setId(id) {
        this.id = id;
    }
    setStatus(status) {
        this.status = status;
    }
    setInactiveText(inactiveText) {
        this.inactiveText = inactiveText;
    }
    setUrls(urls) {
        this.urls = urls;
    }
    setStreams(streams) {
        this.streams = streams;
    }
    build() {
        return this;
    }
}
module.exports = TerminalBuilder
